import React, { Component } from 'react'
import NetworkSearch from './NetworkSearch'
import NetworkCard from './NetworkCard'


export class Network extends Component {

  render() {
    const allAlumni = [
      {firstName: 'Dane1', lastName:'Olsen1', role: 'React Frontend Engineer' , company: 'DaneOlsen Ltd', url: 'linkedin.com'},
      {firstName: 'Dane2', lastName:'Olsen2', role: 'React Frontend Engineer' , company: 'DaneOlsen Ltd', url: 'linkedin.com'},
      {firstName: 'Dane1', lastName:'Olsen1', role: 'React Frontend Engineer' , company: 'DaneOlsen Ltd', url: 'linkedin.com'},

    ]
    return allAlumni.map((alum) => (
          <ul class="collection">
            <NetworkCard alum={alum} />
          </ul>
        ));
  }
}

export default Network
